import React, { useEffect, useState } from "react";

const State = () => {

    const [covidData, setCovidData] = useState([]);
    const getAllCovidData = async () => {
        const url = await fetch('https://dummyjson.com/users');
        let actualData = await url.json();
        setCovidData(actualData);
    }

    useEffect(() => {
        getAllCovidData();
    }, []);
    
    console.log('actual data');
    console.log(covidData.users.length);
    return (
        <>
            <h1 className="text-center">Covid 19 Data</h1>

            <table class="table table-striped">
                <thead>
                    <tr>
                        <th scope="col">Sr</th>
                        <th scope="col">First</th>
                        <th scope="col">Last</th>
                        <th scope="col">Handle</th>
                    </tr>
                </thead>
                <tbody>
                    {
                        covidData.length ?
                            covidData.map((item, index) => {
                                <tr>
                                    <th scope="row">1</th>
                                    <td>Mark</td>
                                    <td>Otto</td>
                                    <td>@mdo</td>
                                </tr>
                            })
                            : null
                    }


                </tbody>
            </table>
        </>
    )
}

export default State;
